def two_surface_plot(x_vals, in1, in2, add_point_x1 = None, add_point_y1 = None, add_point_x2 = None, add_point_y2 = None):
    input1 = available_curves.get(in1)
    input2 = available_curves.get(in2)
    f, ax = plt.subplots(1)
    ax.plot(x_vals, input1)
    ax.plot(x_vals, input2)
    ax.scatter(add_point_x1, add_point_y1)
    ax.scatter(add_point_x2, add_point_y2)
    ax.set_xlim([0, 10])
    ax.set_ylim([0, 1 + max(max(input1), \
                    max(input2))])
    show_plot = plt.show()    
    return show_plot

def abs_diff_surfs(surf_1, surf_2, low_ind, up_ind):
    print("*****")
    print("Inside abs_diff_surfs")
    print("low_ind : ",low_ind)
    print("up_ind : ",up_ind)
    diff = (available_curves.get(surf_1) - available_curves.get(surf_2))[low_ind:up_ind]
    min_ind = np.argmin( abs(diff) ) + low_ind
    print("min_ind : ",min_ind)
    print("Closing abs_diff_surfs")
    print("*****")
    return min_ind

def find_crossing_indices(surf_1, surf_2,flagg=True):
    min_ind_list = []
    cross_count = int(input("Please select the number of desired crossings : "))
    while cross_count > 0:
        # Determining the ranges within which to look for avoided crossings
        while flagg:
            lower_x = round(float(input("Please select the lower limit of the interval within which to look for a crossing : ")), 2)
            upper_x = round(float(input("Please select the upper limit of the interval within which to look for a crossing : ")), 2)
            if (upper_x > lower_x):
                flagg = False
        flagg = True
        two_surface_plot(x, surf_1, surf_2, upper_x, 0, lower_x, 0)
    
        # Determining the range of the y-coordinate lists to be scanned for the crossing    
        print(lower_x, upper_x)
        lower_x_index = list(map(lambda i: i> lower_x, x)).index(True)-1
        upper_x_index = list(map(lambda i: i> upper_x, x)).index(True)
        print(lower_x_index, upper_x_index)
    
        # Determining the index for the crossing within the range indicated
        min_index = abs_diff_surfs(surf_1, surf_2, lower_x_index, upper_x_index)
        print("Min_index is",min_index)
        print("x[min_index] is",x[min_index])
        print("surface_1 is",available_curves.get(surf_1)[min_index])
        min_ind_list.append(min_index)
        #print("surface_1[min_index] is",difference[min_index])
        two_surface_plot(x, surf_1, surf_2, x[min_index], available_curves.get(surf_1)[min_index])
        lower_x = upper_x
        lower_x_index = upper_x_index
        cross_count -= 1
    return min_ind_list

