def diabatize(surf_1, surf_2, index_list):
    counter = 0
    indices = index_list.copy()
    indices.extend([len(available_curves.get(surf_1))])
    intervals = len(indices)
    a, b = 0, indices[counter]
    print("Index list is",indices)
    print("Intervals are",intervals)
    final_list = []
    while counter < len(indices)-1:
        if (counter%2 == 0):
            sur = surf_1
        else:
            sur = surf_2
        final_list.extend(available_curves.get(sur)[a:b])
        counter += 1
        print("a is:",a)
        print("b is:",b)
        print(len(final_list))
        print(final_list)
        a, b = b, indices[counter]
    if sur == surf_1:
        final_list.extend(available_curves.get(surf_2)[a:b])
    else:
        final_list.extend(available_curves.get(surf_1)[a:b])
    return final_list


